import React from "react";
import { NavLink } from "react-router-dom";
import logo from "../assets/LOGO.svg";

const Navigation = () => {
  return (
    <div>
      <img src={logo} alt="Logo kasa" />

      <ul>
        <NavLink to="/">
          <li>Acceuil</li>
        </NavLink>
        <NavLink to="/about">
          <li>A propos</li>
        </NavLink>
      </ul>
    </div>
  );
};

export default Navigation;
